import React from 'react';
import { BrowserRouter as Router, Switch, useHistory, Link } from 'react-router-dom'

// import './App.css';


function home() {
  const history = useHistory();
  const boogleStart = () => history.push('/Boggle');  
  return (
    <div className >
      
      <Router>
      <button onCLick = {boogleStart}>
          start
      </button>
      </Router>
    </div>
  );
}

export default home;
